import {
  Container,
  BreadcrumbItem,
  Row,
  Col,
  Breadcrumb,
  Card,
  CardHeader,
  CardTitle,
  CardImg,
  CardBody,
  CardFooter,
  Button,
  Form,
  FormInput,
  FormGroup,
  Collapse,
  Badge
} from "shards-react";
import Collapsible from "react-collapsible";

import { Tab, Tabs, TabContent } from "react-bootstrap";
import uuidv4 from "uuid";
import Head from "next/head";
import ListeningLayout from "../../listening-components/ListeningLayout";

// Layout
import Layout from "../../components/Layout";
import SEO from "react-seo-component";

const DMM3 = props => (
  <Layout>
    <SEO
      title={"Dime Mucho Mas - Book 3 | CXC Spanish Online"}
      description={
        "Practice your Spanish listening skills with Nick. Pass your CXC Spanish exam with our free online study guide."
      }
      twitterUsername={"_rxhem"}
      author={"Raheem McDonald"}
      article={true}
      publishedDate={new Date()}
      modifiedDate={new Date()}
    />

    <Container>
      <Breadcrumb>
        <BreadcrumbItem>
          <a href="/">Home</a>
        </BreadcrumbItem>
        <BreadcrumbItem>
          <a href="/listening">Dime Series</a>
        </BreadcrumbItem>
        <BreadcrumbItem active>Dime Mucho Mas</BreadcrumbItem>
      </Breadcrumb>

      <ListeningLayout>
        <Card>
          <CardBody>
            <CardTitle>Dime Mucho Mas</CardTitle>
          </CardBody>
        </Card>
      </ListeningLayout>
    </Container>
  </Layout>
);

export default DMM3;
